import React from 'react';
import { streams } from '../data';

const Streams = () => {
  return (
    <div>
      <h1>Streams Page</h1>
     {streams.map((stream) => (
          <h3>Name: {stream}</h3>
      ))}
      </div>
  )
};

export default Streams;
